import Name from "./name";

const users = [
    { name: "John Doe", id: 1 ,age:32},
    { name: "Jane Doe", id: 2 ,age:45},
    { name: "Billy Doe", id: 3,age:23 }
  ];
const Welcome = () =>{
    const names = users.map(user=> <Name name ={user.name} key ={user.id} age ={user.age} />);
    return <div>
        {names}

    </div>
}
export default Welcome;
